import React from 'react';
import axios from 'axios';
import { useState, useEffect } from 'react';

export default function GetData() {
    const [post, setPost] = useState([]);
       
    useEffect(()=>{
        
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then(res => {
            return res.json();
        })
        .then(data =>{
            setPost(data);
        })


    },[]);
    
    return (
        <div>
            <ul>
                {
                    post.map((ele)=>{
                        return (
                            <li key ={ele.id}>
                                {ele.title}
                            </li>
                        )
                    })
                }   
            </ul>
        </div>
    )
}
